import React from 'react'
import ContentCart from './ContentCart.js'

function Cart (props) {
    console.log(props.overPanier)
    return (
        <div>
            <button onClick={props.overPanier= true}>Panier</button>
            {props.overPanier && <ContentCart shoppingContentCart={props.shoppingContentCart} />}
        </div>
    )
}

export default Cart
